import React from "react";
import ReactDOM from "react-dom";
const customStyle = {
  color: "red",
  fontSize: "100px",
  border: "solid 2px black",
};
ReactDOM.render(
  <h1 style={customStyle}>hello World</h1>,
  document.getElementById("root")
);
